#coding=utf8
class Solution(object):
    def findCircleNum(self, M):
        """
        :type M: List[List[int]]
        :rtype: int
        """
        circles = {}
        for i in range(len(M)):
            st = M[i]
            #查看能否合入已有的朋友圈
            for j in range(len(st)):
                relation = st[j]
                if relation == 1:
                    if j in circles:
                        circles[j].append(i)
                    else:
                        circles[j] = [i]

        while True:
            circle_relation = self.get_merge_circles(circles, M)
            if len(circle_relation) == 0:
                break
            else:
                for relation in circle_relation:
                    i, j = relation.split('-')
                    self.do_merge(circles, int(i), int(j))
        return len(circles)

    def get_merge_circles(self, circles, M):
        ret = {}
        keys = circles.keys()
        for i in range(len(keys)):
            sts_i = circles[keys[i]]
            for j in range(i + 1, len(keys)):
                bk = False
                sts_j = circles[keys[j]]
                for st_1 in sts_i:
                    if bk:
                        break
                    relations = M[st_1]
                    for st_2 in sts_j:
                        if relations[st_2] == 1:
                            ret["%d-%d" % (i, j)] = 1
                            bk = True
                            break
        return ret


    def do_merge(self, circles, i, j):
        if i in circles and j in circles:
            circles[i] += circles[j]
            del circles[j]


